import NewsSlider from '../../../widgets/NewsSlider/slider';
import NewsList   from '../../../widgets/NewsList/newsList';

const NewsMain = () => {
    return(
        <div>
            <NewsList
                type="cardMain"
                country={'ca'}
                city={''}
                category={'business'}
                amount={20}
                loadmore={true}
            />
        </div>
    )
}

